import React, { Component } from "react";
import dayjs from "dayjs";
import axios from "axios";
import { toast } from "react-toastify";
import { Card, Button, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle } from 'reactstrap';



const titleStyles = { fontWeight: "bold", padding: "10px 0" };

class Order extends Component {



  generateItems(){
    const {items} = this.props;
    return items.map(item => {
      const {customer_name, table_or_pickup, phone_number, created_time} = item;
      return (
        <div>
        <h6>{`${table_or_pickup}`}</h6>
        <p>{`${item.items.name}`}</p>
        </div>
      );
    });
  }

  render() {
    const { items, customerName, tableOrPickup} = this.props;
    return (
      <div style={{margin: '0 auto', width: '80%', marginBottom: '30px'}}>
        <Card  body>
              <CardTitle>
              <h2>{items[0].customer_name}</h2>
              <h4>{items[0].table_or_pickup}</h4>
              </CardTitle>
              <CardText>
                {this.generateItems()}
              </CardText>
            <Button style={{height: '30px'}}label="Complete" />
            <Button label="Send SMS" />
        </Card>
      </div>
  );
  }
}

export default Order;
